import React from "react";
import { ContentSection, Container, TitleCont, SubtitleCont } from "./styles";


const Perry:React.FC = () => {
    return(
        <div>
            <ContentSection>
                <Container>
                    <TitleCont>Perry Oliveira, o ornitorrinco</TitleCont>
                    <SubtitleCont>Masconte da Eng. Comp</SubtitleCont>
                </Container>
            </ContentSection>
        </div>
    )
}

export default Perry;
